import react from "react";
import { Card } from "antd";

function TestCard() {
  return (
    <div>
      <Card
        title={
          <p>
            <b>SSID</b>Aegis Research
          </p>
        }
        style={{
          width: 300,
          margin: "20px",
          borderRadius: "20px",
          overflow: "hidden",
        }}
      >
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
      </Card>
    </div>
  );
}

export default TestCard;
